import React from "react";
//import { RegenertateCILItemList, listItem } from "./genertaeCILItemList";
import { CILItem } from "../Components/costIncomListItem";
import { useExampleData } from "../Data/list";

export function GenerateCIL(){

    //RegenertateCILItemList()

    const { exampleData } = useExampleData();

    return (<ul id="CostIncomList" style={{top:-10, left:-35, position:"relative"}}>
                {exampleData.map((item) => (<li key={item.id}> <CILItem state={item.state} 
                                          date={item.date.day.toString().padStart(2, '0') + "." + item.date.month.toString().padStart(2, '0') + "." + item.date.year}
                                          amount={item.amount} id={item.id} x={5}/></li>))} 
            </ul>)
    
}
